otype.sheet=function(e){return this.spreadsheet.getSheetByName(e)};Spreadsheet.prototype.get_sheet=function(e){return this.spreadsheet.getSheetByName(e).activate()};Spreadsheet.prototype.search_column=function(e,t,r){var a=SpreadsheetApp.getActiveSpreadsheet().getSheetByName(e);var n=a.getRange(t+":"+t);var s=n.getValues().toString().split(",");s=s.filter(function(e){return e});if(s.indexOf(r)>-1){return"yes"}else{return"no"}};Spreadsheet.prototype.search_column_index=function(e,t,r){var a=SpreadsheetApp.getActiveSpreadsheet().getSheetByName(e);var n=a.getRange(t+":"+t);var s=n.getValues().toString().split(",");s=s.filter(function(e){return e});var s=n.getValues();var p=0;while(s[p]&&s[p][0]!==r){p++}var g;try{if(s[p][0]===r){g=p+1}else{g=-1}}catch(i){g="none"}if(g>0){return t+g}else{return g}};Spreadsheet.prototype.set_range=function(e,t,r){return SpreadsheetApp.getActiveSpreadsheet().getSheetByName(e).getRange(t).setValues([r])};function ui_prompt(e){return SpreadsheetApp.getUi().prompt(e)}